import React from 'react';
import { Box, Typography } from '@mui/material';

interface CVSectionProps {
  title: string;
  children: React.ReactNode;
}

export const CVSection: React.FC<CVSectionProps> = ({ title, children }) => {
  return (
    <Box sx={{ mb: 4 }}>
      <Typography
        variant="h6"
        sx={{
          color: 'primary.main',
          mb: 2,
          fontWeight: 500,
        }}
      >
        {title}
      </Typography>
      {children}
    </Box>
  );
};
